import "./App.css";
import Home from "./Home.js";
import Add from "./Add.js";
import { Route, Routes } from "react-router-dom";

function App() {
  return (
    <Routes>
      <Route path="/" styles={{ backgroundColor: "gray" }} element={<Home />} />
      <Route path="/add" element={<Add />} />
    </Routes>
  );
}

export default App;
